def _preprocess_numpy_input(x, data_format, mode):
    if mode == 'tf':
        x /= 127.5
        x -= 1.
    elif mode == 'torch':
        x /= 255.
        mean = [0.485, 0.456, 0.406]
        std = [0.229, 0.224, 0.225]
    else:
        if data_format == 'channels_first':
            if x.ndim == 3:
                x = x[:, ::-1, ...]
            else:
                x = x[:, :, ::-1, ...]
            mean = [103.939, 116.779, 123.68]
            std = None
        else:
            x = x[..., ::-1]
            mean = [103.939, 116.779, 123.68]
            std = None

    if mode == 'torch':
        if std is not None:
            x = (x - mean) / std
        else:
            x = x - mean
    else:
        x = x / 255.0

    return x
